import googleIcon from "assets/images/logo/goo.png" 

const LoginButton = () => {
    
    return(
        <div className="flex justify-center h-[60%] mt-[1%]">
            <img src={googleIcon}></img>
            <div className="w-[75%] bg-white border border-black rounded-xl">
                구글 계정으로 계속하기
            </div>
        </div>
    )
}

export default LoginButton;
